import React, {Component} from 'react';

export default class CreateUser extends Component {

    constructor(props){
        super(props);

        this.state = {
            username: '',
            email: '',
            phone_no: 0
        }
    }

    onChangeUsername(e){
        this.setState({
            username: e.target.value
        });
    }
    onChangeEmail(e){
        this.setState({
            email: e.target.value
        });
    }
    onChangePhoneNo(e){
        this.setState({
            phone_no: e.target.value
        });
    }

    render (){
        return (
            <div>
                <p>You are on create user component.</p>
            </div>
        )
    }
}
